Player *pLocal = new Player();

Player::Player() {

}

Player::~Player() {

}

DWORD Player::getLocalPlayer() {
	return m->ReadMem<DWORD>(m->cDll.dwBase + offsets::dwLocalPlayer);
}

unsigned int Player::getTeam() {
	return m->ReadMem<int>(getLocalPlayer() + offsets::m_iTeamNum);
}

unsigned int Player::getFlags() {
	return m->ReadMem<int>(getLocalPlayer() + offsets::m_fFlags);
}

unsigned int Player::getCrosshair() {
	return m->ReadMem<int>(getLocalPlayer() + offsets::m_iCrosshairId);
}

bool Player::isMoving() {
	vec3 playerVelocity = m->ReadMem<vec3>(getLocalPlayer() + offsets::m_vecVelocity);

	int velocity = playerVelocity.x + playerVelocity.y + playerVelocity.z;

	if (velocity != 0)
		return true;
	else
		return false;
}

